import { css } from "styled-components";

export const ValignTextMiddle = css`
  display: flex;
  flex-direction: column;
  justify-content: center;
`;

export const PoppinsNormalPinkSwan14px = css`
  color: var(--pink-swan);
  font-family: var(--font-family-poppins);
  font-size: var(--font-size-m);
  font-weight: 400;
  font-style: normal;
`;

export const PoppinsNormalWhite24px = css`
  color: var(--white);
  font-family: var(--font-family-poppins);
  font-size: 14px;
  font-weight: 400;
  font-style: normal;
`;

export const PoppinsNormalPinkSwan16px = css`
  color: var(--pink-swan);
  font-family: var(--font-family-poppins);
  font-size: var(--font-size-l);
  font-weight: 400;
  font-style: normal;
`;

export const PoppinsNormalWhite16px = css`
  color: var(--white);
  font-family: var(--font-family-poppins);
  font-size: var(--font-size-l);
  font-weight: 400;
  font-style: normal;
`;

export const PoppinsNormalBlack24px = css`
  color: var(--black-2);
  font-family: var(--font-family-poppins);
  font-size: var(--font-size-xxxl2);
  font-weight: 400;
  font-style: normal;
`;

export const PoppinsNormalGraniteGray14px = css`
  color: var(--granite-gray);
  font-family: var(--font-family-poppins);
  font-size: var(--font-size-m);
  font-weight: 400;
  font-style: normal;
`;

export const PoppinsNormalEerieBlack18px = css`
  color: var(--eerie-black);
  font-family: var(--font-family-poppins);
  font-size: var(--font-size-xl);
  font-weight: 400;
  font-style: normal;
`;

export const PoppinsNormalEerieBlack14px = css`
  color: var(--eerie-black);
  font-family: var(--font-family-poppins);
  font-size: var(--font-size-m);
  font-weight: 400;
  font-style: normal;
`;

export const Border05pxWhite2 = css`
  border: 0.5px solid var(--white-2);
`;



// Otp Page

export const PoppinsNormalBlack36px = css`
  color: var(--black-2);
  font-family: var(--font-family-poppins);
  font-size: var(--font-size-xxxxxl);
  font-weight: 400;
  font-style: normal;
`;

export const PoppinsNormalWhite14px = css`
  color: var(--white);
  font-family: var(--font-family-poppins);
  font-size: var(--font-size-m2);
  font-weight: 400;
  font-style: normal;
`;


export const PoppinsNormalPeachCream18px = css`
  color: var(--peach-cream);
  font-family: var(--font-family-poppins);
  font-size: var(--font-size-xl2);
  font-weight: 400;
  font-style: normal;
`;

export const PoppinsNormalEerieBlack24px = css`
  color: var(--eerie-black);
  font-family: var(--font-family-poppins);
  font-size: var(--font-size-xxxl2);
  font-weight: 400;
  font-style: normal;
`;


export const PoppinsNormalPinkSwan18px = css`
  color: var(--pink-swan);
  font-family: var(--font-family-poppins);
  font-size: var(--font-size-xl2);
  font-weight: 400;
  font-style: normal;
`;

export const Border1pxBlack2 = css`
  border: 1px solid var(--black-2);
`;

export const PoppinsNormalPeachCream14px = css`
  color: var(--peach-cream);
  font-family: var(--font-family-poppins);
  font-size: var(--font-size-m2);
  font-weight: 400;
  font-style: normal;
`;


// Enter Number
export const Poppins2NormalPeachCream18px = css`
  color: var(--peach-cream);
  font-family: var(--font-family-poppins);
  font-size: var(--font-size-xl);
  font-weight: 400;
  font-style: normal;
`;

export const Poppins2NormalPinkSwan18px = css`
  color: var(--pink-swan);
  font-family: var(--font-family-poppins);
  font-size: var(--font-size-xl);
  font-weight: 400;
  font-style: normal;
`;

export const PoppinsNormalPeachCream16px = css`
  color: var(--peach-cream);
  font-family: var(--font-family-poppins);
  font-size: var(--font-size-l2);
  font-weight: 400;
  font-style: normal;
`;
